/* eslint-disable no-undef */
import React from 'react';
import jQuery from 'jquery';
import { jsPDF } from 'jspdf';
// import Style from 'style-it';
// import ReactDOMServer from "react-dom/server";



const credentialFormDiv = {
        // margin: '15px',
}
const errorStyle = {
        background: '#ea6f6f',
        border: 'none',
}

const successStyle = {
        background: '#a7cc4d',
        setTextColor: '#000',
}
var createReactClass = require('create-react-class');

var FormCheck = createReactClass({
        getInitialState: function () {
                return {
                        firstValue: "",
                        firstLabel: "",
                        secondValue: "",
                        secondLabel: "",
                        thirdValue: "",
                        fourthValue: "",
                        fourthLabel: "",
                        fifthValue: "",
                        submitValue: 0,
                        buttonValue: 0,
                        successValue: 0
                }
        },
        handleFirstLevelChange: function (event) {
                let index = event.nativeEvent.target.selectedIndex;
                this.setState({
                        firstValue: event.target.value,
                        firstLabel: event.nativeEvent.target[index].text,
                        secondValue: "",
                        secondLabel: "",
                        thirdValue: "",
                        fourthValue: "",
                        fourthLabel: "",
                        fifthValue: "",
                        submitValue: 0,
                        buttonValue: 0
                });
        },
        handleSecondLevelChange: function (event) {
                let index = event.nativeEvent.target.selectedIndex;
                this.setState({
                        secondValue: event.target.value,
                        secondLabel: event.nativeEvent.target[index].text,
                        thirdValue: "",
                        fourthValue: "",
                        fourthLabel: "",
                        fifthValue: "",
                        buttonValue: 0
                });
        },
        handleThirdLevelChange: function (event) {
                this.setState({
                        thirdValue: event.target.value,
                        fourthValue: "",
                        fourthLabel: "",
                        fifthValue: "",
                        buttonValue: 0
                });
        },
        handleFourthLevelChange: function (event) {
                let index = event.nativeEvent.target.selectedIndex;
                this.setState({
                        fourthValue: event.target.value,
                        fourthLabel: event.nativeEvent.target[index].text,
                        fifthValue: ""
                });

                if (event.target.value === "industry_wide_Technical") {
                        this.setState({
                                buttonValue: 0
                        });
                }
                else {
                        this.setState({
                                buttonValue: 1
                        });
                }
        },
        handleFifthLevelChange: function (event) {
                this.setState({
                        fifthValue: event.target.value
                });

                if (event.target.value === "") {
                        this.setState({
                                buttonValue: 0
                        });
                }
                else {
                        this.setState({
                                buttonValue: 1
                        });
                }
        },
        getSecondLevelField: function () {
                if (!this.state.firstValue || this.state.firstValue === "other") {
                        return null;
                }

                return (
                        <div className="questions" role="listbox" aria-labelledby="listbox1label" tabindex="0">
                                <label>What type of credential is it?</label>
                                <select onChange={this.handleSecondLevelChange} value={this.state.secondValue} id="type-of-credential" name="type_of_credential" >
                                        <option value="">---</option>
                                        <option value="secondary_school">Secondary School Diploma/Equivalent</option>
                                        <option value="associate_degree">Associate Degree</option>
                                        <option value="bachelor_degree">Bachelor Degree</option>
                                        <option value="occupational_licensure">Occupational Licensure</option>
                                        <option value="occupational_certificate">Occupational Certificate (including Registered Apprenticeship and Career and Technical Education certificates)</option>
                                        <option value="occupational_certification">Occupational Certification</option>
                                        <option value="other_industry">Other Industry/Occupational Skills Completion</option>
                                        <option value="other">Other</option>
                                        <option value="graduate_degree">Graduate Degree (VR-only)</option>
                                </select>
                        </div>
                )
        },
        getThirdLevelField: function () {
                if (this.state.secondValue !== "graduate_degree") {
                        return null;
                }

                return (
                        <div className="questions" role="listbox" aria-labelledby="listbox2label" tabindex="0">
                                <label>Is the participant receiving training/education through VR?</label>
                                <select onChange={this.handleThirdLevelChange} value={this.state.thirdValue} id="education-vr" name="education_through_vr">
                                        <option value="">---</option>
                                        <option value="Yes">Yes</option>
                                        <option value="No">No</option>
                                </select>
                        </div>
                )
        },
        getFourthLevelField: function () {
                if (!this.state.secondValue && this.state.firstValue !== "other") {
                        return null;
                }
                else if (this.state.secondValue === "graduate_degree" && this.state.thirdValue === "") {
                        return null;
                }

                return (
                        <div className="questions" role="listbox" aria-labelledby="listbox3label" tabindex="0">
                                <label>What type of skills does it attest to?</label>
                                <select onChange={this.handleFourthLevelChange} value={this.state.fourthValue} id="type-of-skill" name="type_of_skill">
                                        <option value="">---</option>
                                        <option value="industry_wide_Technical">Industry-wide Technical or Industry/Occupational Skills</option>
                                        <option value="general_safety">General Safety Skills</option>
                                        <option value="work_readiness">Work Readiness Skills</option>
                                        <option value="hygiene_skills">Hygiene Skills</option>
                                        <option value="general_computer">General Computer Skills (e.g. word/excel/outlook/PPT/etc)</option>
                                        <option value="other_general">Other General Skills</option>
                                </select>
                        </div>
                )
        },
        getFifthLevelField: function () {
                if (this.state.fourthValue !== "industry_wide_Technical") {
                        return null;
                }

                return (
                        <div className="questions" role="listbox" aria-labelledby="listbox4label" tabindex="0">
                                <label>Is the training related to an in-demand industry/occupation in the local area?</label> <p className="desc" style={{ fontWeight: 'normal' }}>20 C.F.R. 680.210 (b) requires training to be directly linked to the employment opportunities in the local area or the planning region, or in another area to which the individuals are willing to commute or relocate.</p>
                                <select onChange={this.handleFifthLevelChange} value={this.state.fifthValue} id="in-demand-industry" name="in_demand_industry">
                                        <option value="">---</option>
                                        <option value="Yes">Yes</option>
                                        <option value="No">No</option>
                                </select>
                        </div>
                )
        },
        getFirstValueMessage: function () {
                if (this.state.firstValue === "other" && this.state.firstValue !== "") {
                        return (
                                <div id="firstmessage" style={{ background: '#ecca22', setTextColor: '#000', }} className="messages" >Warning: Other organizations not listed may award credentials. If "other" confirm that the organization awards recognized credentials.</div>);
                }
                return null;

        },
        getSecondValueMessage: function () {
                if (this.state.secondValue === "other" && this.state.secondValue !== "") {
                        return (<div id="secondmessage" style={{ background: '#ea6f6f', border: 'none', }} className="messages">Credentials other than those listed do not count as a success in the Credential Attainment Numerator, even though there are cases where they may be useful and/or necessary for the participant.</div>);
                }
                return null;
        },
        getThirdValueMessage: function () {
                if (this.state.secondValue === "graduate_degree" && this.state.thirdValue === "No") {
                        return (<div id="thirdmessage" style={{ background: '#ea6f6f', border: 'none', }} className="messages">Graduate Degrees can only count as a success for the WIOA title IV Vocational Rehabilition program.</div>);
                }
                return null;
        },
        getFourthValueMessage: function () {
                if (this.state.fourthValue !== "industry_wide_Technical" && this.state.fourthValue !== "") {
                        return (<div id="fourthmessage" style={{ background: '#ea6f6f', border: 'none', }} className="messages">A recognized postsecondary credential is awarded in recognition of an individual's attainment of measurable technical or industry/occupational skills necessary to obtain employment or advance within an industry/occupation.</div>);
                }
                return null;
        },
        getFifthValueMessage: function () {
                if (this.state.fourthValue === "industry_wide_Technical" && this.state.fifthValue === "No") {
                        return (<div id="fifthmessage" style={{ background: '#ecca22', setTextColor: '#000', }} className="messages">While this may count as a credential, note that WIOA title I funds can only be used to pay for training that is related to an in-demand industry or occupation.</div>);
                }
                return null;
        },
        getMessage: function () {
                // eslint-disable-next-line no-unused-vars
                var incomplete = "";

                if (this.state.buttonValue !== 1) {
                        return null;
                }
                else if (this.state.fourthValue !== "industry_wide_Technical" || this.state.secondValue === "other" || (this.state.secondValue === "graduate_degree" && this.state.thirdValue === "No")) {
                        return (<div id="lastmessage" className="error" style={errorStyle}><b>BASED ON YOUR INPUTS, THIS IS</b> not a WIOA Post Secondary Credential.</div>);
                }
                else {
                        return (<div id="lastmessage" className="success" style={successStyle}><b>BASED ON YOUR INPUTS, THIS IS</b> a WIOA Post Secondary Credential.</div>);
                }

                // eslint-disable-next-line no-unreachable
                return null;
        },
        showPrintButton: function (_event) {
                if (this.state.buttonValue === 1) {
                        return (<button onClick={this.handlePrintButtonClick}>Export PDF</button>);
                }
                return null;
        },
        handleCSVButtonClick: function (event) {
                event.preventDefault();
                var csv = [];

                var rows = document.querySelectorAll("div.questions");
                var row = [];
                for (var i = 0; i < rows.length; i++) {
                        var cols = rows[i].querySelectorAll("label");
                        for (var j = 0; j < cols.length; j++) {
                                row.push("\"" + cols[j].innerText + "\"");
                        }
                }
                row.push("\"Result\"");
                csv.push(row.join(","));

                // eslint-disable-next-line no-redeclare
                var row = [];
                // eslint-disable-next-line no-redeclare
                for (var i = 0; i < rows.length; i++) {
                        // eslint-disable-next-line no-redeclare
                        var cols = rows[i].querySelectorAll("select");
                        // eslint-disable-next-line no-redeclare
                        for (var j = 0; j < cols.length; j++) {
                                if (cols[j].type === "select-one") {
                                        row.push("\"" + cols[j].selectedOptions[0].label + "\"");
                                }
                        }
                }
                var result = jQuery("#lastmessage").text();
                row.push("\"" + result + "\"");
                csv.push(row.join(","));

                var csvcontent = csv.join("\r\n");

                var csvFile;
                var downloadLink;

                if (window.Blob === undefined || window.URL === undefined || window.URL.createObjectURL === undefined) {
                        alert("Your browser doesnt support Blobs");
                        return;
                }

                csvFile = new Blob([csvcontent], { type: "text/csv" });
                downloadLink = document.createElement("a");
                downloadLink.download = "Credential Type.csv";
                downloadLink.href = window.URL.createObjectURL(csvFile);
                downloadLink.style.display = "none";
                document.body.appendChild(downloadLink);
                downloadLink.click();
        },

        handlePrintButtonClick: function (event) {
                event.preventDefault();
                // const pdf = new jsPDF({
                //         orientation: "landscape",
                //         unit: "in",
                //         format: [4, 2]
                // });
                // const pdf = new jsPDF("p", "mm", "a4");
                var successValue = 0;

                if (this.state.fourthValue !== "industry_wide_Technical" || this.state.secondValue === "other" || (this.state.secondValue === "graduate_degree" && this.state.thirdValue === "No")) {
                        successValue = 1;
                }
                var imgData = "data:image/png;base64,";
                var source;
                // const jsPDF = require('jspdf');
                var pdf = new jsPDF("p", "pt", "letter");

                var i = 170;

                pdf.setFillColor(0, 113, 188);
                pdf.rect(0, 0, 700, 75, "F");

                pdf.setFontSize(20);
                pdf.setTextColor(255, 255, 255);
                pdf.text("Postsecondary Credential Attainment Decision Tree", 70, 60);

                var header_logo = "data:image/jpeg;base64,";
                pdf.addImage(header_logo, "JPEG", 65, 75, 60, 29)

                pdf.setFontSize(10);
                pdf.setTextColor(0, 0, 0);
                pdf.text("What type of organization or institution is offering the training program?", 70, 130);
                pdf.setFillColor(238, 238, 238);
                pdf.rect(70, 140, 500, 30, "F");
                pdf.text(this.state.firstLabel, 75, 160);
                // pdf.save("two-by-four.pdf");


                if (this.state.secondLabel) {
                        pdf.text("What type of credential is it?", 70, i + 30);
                        pdf.setFillColor(238, 238, 238);
                        pdf.rect(70, i + 40, 500, 30, "F");
                        pdf.text(this.state.secondLabel, 75, i + 60);
                        i = i + 70;
                }

                if (this.state.thirdValue) {
                        pdf.text("Is the participant receiving training/education through VR?", 70, i + 30);
                        pdf.setFillColor(238, 238, 238);
                        pdf.rect(70, i + 40, 500, 30, "F");
                        pdf.text(this.state.thirdValue, 75, i + 60);
                        i = i + 70;
                }

                if (this.state.fourthLabel) {
                        pdf.text("What type of skills does it attest to?", 70, i + 30);
                        pdf.setFillColor(238, 238, 238);
                        pdf.rect(70, i + 40, 500, 30, "F");
                        pdf.text(this.state.fourthLabel, 75, i + 60);
                        i = i + 70;
                }

                if (this.state.fifthValue) {
                        pdf.text("Is the training related to an in-demand industry/occupation in the local area?", 70, i + 30);
                        pdf.setFillColor(238, 238, 238);
                        pdf.rect(70, i + 40, 500, 30, "F");
                        pdf.text(this.state.fifthValue, 75, i + 60);
                        i = i + 70;
                }

                if (jQuery("#firstmessage").length > 0) {
                        var iconData = "data:image/jpeg;base64,";
                        pdf.addImage(iconData, "JPEG", 70, i + 25, 30, 26)
                        pdf.setFillColor(236, 202, 34);
                        pdf.roundedRect(120, i + 10, 430, 50, 5, 5, "F");
                        var splitContent = pdf.splitTextToSize(jQuery("#firstmessage").html(), 415);
                        pdf.text(splitContent[0], 130, i + 30);
                        pdf.text(splitContent[1], 130, i + 45);
                        i = i + 60;
                }

                if (jQuery("#secondmessage").length > 0) {
                        // eslint-disable-next-line no-redeclare
                        var iconData = "data:image/jpeg;base64,";
                        pdf.addImage(iconData, "JPEG", 70, i + 25, 30, 26)
                        pdf.setFillColor(234, 111, 111);
                        pdf.roundedRect(120, i + 10, 430, 70, 5, 5, "F");
                        // eslint-disable-next-line no-redeclare
                        var splitContent = pdf.splitTextToSize(jQuery("#secondmessage").html(), 415);
                        pdf.setTextColor(255, 255, 255);
                        pdf.text(splitContent[0], 130, i + 30);
                        pdf.text(splitContent[1], 130, i + 45);
                        pdf.text(splitContent[2], 130, i + 60);
                        i = i + 80;
                }

                if (jQuery("#thirdmessage").length > 0) {
                        // eslint-disable-next-line no-redeclare
                        var iconData = "data:image/jpeg;base64,";
                        pdf.addImage(iconData, "JPEG", 70, i + 15, 30, 26)
                        pdf.setFillColor(234, 111, 111);
                        pdf.roundedRect(120, i + 10, 430, 50, 5, 5, "F");
                        // eslint-disable-next-line no-redeclare
                        var splitContent = pdf.splitTextToSize(jQuery("#thirdmessage").html(), 415);
                        pdf.setTextColor(255, 255, 255);
                        pdf.text(splitContent[0], 130, i + 30);
                        pdf.text(splitContent[1], 130, i + 45);
                        i = i + 60;
                }

                if (jQuery("#fourthmessage").length > 0) {
                        // eslint-disable-next-line no-redeclare
                        var iconData = "data:image/jpeg;base64,";
                        pdf.addImage(iconData, "JPEG", 70, i + 25, 30, 26)
                        pdf.setFillColor(234, 111, 111);
                        pdf.roundedRect(120, i + 10, 430, 70, 5, 5, "F");
                        // eslint-disable-next-line no-redeclare
                        var splitContent = pdf.splitTextToSize(jQuery("#fourthmessage").html(), 415);
                        pdf.setTextColor(255, 255, 255);
                        pdf.text(splitContent[0], 130, i + 30);
                        pdf.text(splitContent[1], 130, i + 45);
                        pdf.text(splitContent[2], 130, i + 60);
                        i = i + 80;
                }
                pdf.setTextColor(0, 0, 0);
                if (jQuery("#fifthmessage").length > 0) {
                        // eslint-disable-next-line no-redeclare
                        var iconData = "data:image/jpeg;base64,";
                        pdf.addImage(iconData, "JPEG", 70, i + 15, 30, 26)
                        pdf.setFillColor(236, 202, 34);
                        pdf.roundedRect(120, i + 10, 430, 50, 5, 5, "F");
                        // eslint-disable-next-line no-redeclare
                        var splitContent = pdf.splitTextToSize(jQuery("#fifthmessage").html(), 415);
                        pdf.text(splitContent[0], 130, i + 30);
                        pdf.text(splitContent[1], 130, i + 45);
                        i = i + 60;
                }

                if (jQuery("#lastmessage").length > 0) {
                        if (successValue === 0) {
                                var val = "a WIOA Post Secondary Credential.";
                                // eslint-disable-next-line no-redeclare
                                var iconData = "data:image/jpeg;base64,";
                                pdf.addImage(iconData, "JPEG", 70, i + 12, 26, 26)
                                pdf.setFillColor(167, 204, 77);
                        }
                        else {
                                // eslint-disable-next-line no-redeclare
                                var val = "not a WIOA Post Secondary Credential.";
                                pdf.setTextColor(255, 255, 255);
                                // eslint-disable-next-line no-redeclare
                                var iconData = "data:image/jpeg;base64,";
                                pdf.addImage(iconData, "JPEG", 70, i + 12, 30, 26)
                                pdf.setFillColor(234, 111, 111);
                        }
                        pdf.roundedRect(120, i + 10, 430, 30, 5, 5, "F");
                        // pdf.setFontType("bold");
                        pdf.text("BASED ON YOUR INPUTS, THIS IS ", 130, i + 30);
                        // pdf.setFontType("normal");
                        pdf.text(val, 300, i + 30);
                        i = i + 40;
                }

                pdf.addImage(imgData, "PNG", 225, pdf.internal.pageSize.height - 100, 200, 38)
                pdf.setFillColor(0, 113, 188);
                pdf.rect(0, pdf.internal.pageSize.height - 30, 700, 75, "F");

                source = " ";

                // var margins = {
                //         top: 400,
                //         bottom: 60,
                //         left: 75,
                //         width: 522
                // };

                // pdf.fromHTML(
                //         source, // HTML string or DOM elem ref.
                //         margins.left, // x coord
                //         margins.top, {
                //         // y coord
                //         width: margins.width // max width of content on PDF
                // },
                //         function (_dispose) {
                //                 // dispose: object with X, Y of the last line add to the PDF
                //                 //          this allow the insertion of new lines after html
                //                 pdf.save("Credential Type.pdf");
                //         },
                //         margins
                // );
                pdf.save("Credential Type.pdf");
        },
        showCSVButton: function (_event) {
                if (this.state.buttonValue === 1) {
                        return (<button onClick={this.handleCSVButtonClick}>Export CSV</button>);
                }
        },
        render: function () {
                return (

                        <form onSubmit={this.registerUser} id="credential_form" method="post" target="_blank">
                                <div className="questions" style={credentialFormDiv} role="listbox" aria-labelledby="listbox5label" tabindex="0">
                                        <label>What type of organization or institution is offering the training program?</label>
                                        <select onChange={this.handleFirstLevelChange} value={this.state.firstValue} id="type-of-institution" name="type_of_institution">
                                                <option value="">---</option>
                                                <option value="state_agency">State Agency</option>
                                                <option value="higher_education">Institution of Higher Education</option>
                                                <option value="native_american">Indian/Native American Tribal Organization</option>
                                                <option value="professional_organization">Professional/Industry/Employer Organization</option>
                                                <option value="recognized_state">ETA Office of Apprenticeship or Recognized State Apprenticeship Agency</option>
                                                <option value="public_license">Public RegulatoryAgency/Government Licensing Entity</option>
                                                <option value="veterans_affairs">Dept of Veteran\'s Affairs (VA)-approved program</option>
                                                <option value="job_corps">Job Corps</option>
                                                <option value="other">Other</option>
                                        </select>
                                </div>
                                {this.getFirstValueMessage()}
                                {this.getSecondLevelField()}
                                {this.getSecondValueMessage()}
                                {this.getThirdLevelField()}
                                {this.getThirdValueMessage()}
                                {this.getFourthLevelField()}
                                {this.getFourthValueMessage()}
                                {this.getFifthLevelField()}
                                {this.getFifthValueMessage()}
                                {this.getMessage()}
                                {this.showPrintButton()}
                                {this.showCSVButton()}
                        </form>
                )
        }
});

export default FormCheck;
